MOVES = {"U": (0, -1),
		 "R": (1, 0),
		 "D": (0, 1),
		 "L": (-1, 0)
		}

KEYPAD = [[1, 2, 3], 
          [4, 5, 6],
          [7, 8, 9]]

class Position():
	"""Position in R^2"""
	def __init__(self, x, y):
		self.x = x
		self.y = y

	def move(self, command):
		if self.move_available(command):
			self.x += MOVES[command][0]
			self.y += MOVES[command][1]
		else:
			pass

	def get(self):
		return self.x, self.y

	def move_available(self, move):
		dx, dy = MOVES[move]
		new_x = self.x + dx
		new_y = self.y + dy
		if new_x < 3 and new_x > -1 and new_y < 3 and new_y > -1:
			return True
		return False


def findCode(inpt):
	mv_sequences = inpt.split(" ")
	pos = Position(1, 1)
	code = ""
	for sequence in mv_sequences:
		for command in sequence:
			pos.move(command)
		x, y = pos.get()
		code += str(KEYPAD[y][x])
	return code

inpt = "    "
print(findCode(inpt))